'use strict';

angular
    .module('myApp', ['ui.router', 'angular.morris'])

    .config([
        '$stateProvider', '$urlRouterProvider',
        function($stateProvider, $urlRouterProvider) {
            $stateProvider
                .state('home', {
                    url: '/',
                    templateUrl: 'html/main.html'
                });

            $urlRouterProvider.otherwise('/');
        }])

    .run(['$rootScope', '$state',
        function ($rootScope, $state) {
            $rootScope.$state = $state;
        }]);
'use strict';

angular
    .module('myApp')
    
    .controller('cardWidgetCtrl', [
        '$scope', '$http',
        function($scope, $http) {
            $http.get('./data/card.json')
                .then(function(data) {
                    $scope.card = data.data;
                });
        }
    ]);
'use strict';

angular
    .module('myApp')
    
    .controller('chartWidgetCtrl', [
        '$scope', '$http',
        function($scope, $http) {
            $http.get('./data/donut.json')
                .then(function(data) {
                    $scope.donut = data.data;
                });

            $scope.formatter = function(value) {
                return value + 'Gb';
            };
            
            $http.get('./data/bar.json')
                .then(function(data) {
                    $scope.bar = data.data;
                });
        }
    ]);
'use strict';

angular
    .module('myApp')
    
    .controller('langWidgetCtrl', [
        '$scope', '$http',
        function($scope, $http) {
            $scope.pageLang = "eng";
            
            $scope.setLang = function(lang){
                if (lang==="esp"){
                    $http.get('./data/lang/esp.json')
                        .then(function(data) {
                            $scope.lang = data.data;
                        });
                } else {
                    $http.get('./data/lang/eng.json')
                        .then(function(data) {
                            $scope.lang = data.data;
                        });
                }
                $scope.pageLang = lang;                
            }

        }
    ]);
'use strict';

angular
    .module('myApp')
    
    .controller('menuWidgetCtrl', [
        '$scope', '$http',
        function($scope, $http) {
            $http.get('./data/menu.json')
                .then(function(data) {
                    $scope.menu = data.data;
                });
        }
    ]);
'use strict';

angular
    .module('myApp')
    
    .controller('profileWidgetCtrl', [
        '$scope', '$http',
        function($scope, $http) {
            $http.get('./data/profile.json')
                .then(function(data) {
                    $scope.profile = data.data;
                });
        }
    ]);
'use strict';

angular
    .module('myApp')
    
    .directive('uploadFile', function() {
        return {
            link: function(scope, element, attributes) {

            var el = angular.element(element)
            var button = el.children()[0]

            var fileInput = angular.element('<input type="file" multiple style="position:absolute; width:100%; height:100%; top:0; left:0; opacity:0; z-index:2"/>')

            el.append(fileInput)


            }
        }
    });